INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(1, 'BMW i3', 'Get in and experience the future at your fingertips. The BMW i3 is full of innovative technologies it can use to confidently master your day-to-day life. It connects you to the outside world, updates you about what\'s going on, keeps you organised, and takes you as far as you want to go. It is always ready for the road and to explore new avenues. With style and a trend-setting design for electrifying driving pleasure.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(2, 'BMW 4 Series Convertible', 'A new form of freedom: With its independent, progressive aesthetics and the elegant interior, the all-new BMW 4 Series Convertible is like an exceptional phenomenon that overcomes every boundary. The agile driving characteristics of the convertible guarantee sporty dynamics and underline its exceptionally strong urge for individual independence.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(3, 'BMW 6 SERIES GRAN TURISMO', 'Individuality is its passion. This is why the BMW 6 Series Gran Turismo is making its first appearance with exclusive and high-quality equipment features from BMW Individual. The fascinating BMW Individual paint finishes of Tanzanite Blue metallic and Dravit Grey metallic allow you to set an exceptional highlight. In combination with the impressive 20 BMW Individual style 649 I wheels, the vehicle has a perfectly unique character. You can also adapt the interior to your preferences: the high-qu', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(4, 'BMW M850i xDrive', 'Power. Control. Comfort. Thanks to its unique design, exceptional agility and impressive engines, the BMW 8 Series Coup raises the bar for luxury motoring. Combined with exclusive racing features, the luxury sports car is the perfect fusion of top quality and maximum performance.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(5, 'Toyota SUPRA 2.0L', 'Developed by Toyota Gazoo Racing, who in the development process, subjected the car through the toughest tests, the All-New Toyota GR Supra is reborn! Featuring a straight-6 turbocharged engine, the Supra pumps out an incredible 500Nm of torque and has a staggering 0-100km/h time of 4.3 seconds. And with its perfectly balanced 50:50 front and rear weight distribution and a lightweight yet highly rigid chassis, it\'s no wonder some people are calling it an engineering marvel.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(6, 'Toyota CAMRY 2.5', 'Better than ever with exhilarating sleek styling, luxurious comfort and engineered for intelligence through Toyota New Global Architecture (TNGA) and Toyota Safety Sense while retaining values of superlative build quality, reliability and safety.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(7, 'Subaru WRX STI', 'Rally born and bred, the WRX STI is the worldrenowned race legend that\'s only grown better with every victory. With its tracktuned suspension, supreme handling, exhilarating acceleration, and unmistakable hood scoop, the STI screams rally champion on any road  even when parked. Checkered flags sold separately.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(8, 'Subaru BRZ', 'Take that corner. Hit the inside edge. Master your exit. A pure sports car in every sense, the BRZ is the one and only coupe and only rear-wheel drive vehicle in the Subaru lineup. Climb in and you\'ll see how it makes every day feel like track day.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(9, 'Nissan GT-R', 'It isnt found in a lap time. Or a 0100 number. Or even on a price tag. Its built on an obsession to detail. And a radical belief that a real supercar delivers performance in real-world conditions. Anywhere. Anytime. So refined, anyone can drive it. Yet so capable, in the right hands it can turn the automotive world on its ear. The Nissan GT-R. Its history speaks of world-beating performance, but the pursuit will always be of pure exhilaration.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(10, 'Porsche 911 Carrera', 'A timeless design, a contemporary interpretation. The unmistakable silhouette of the 911 is characterised by its iconic flyline. It has barely changed since 1963, and has shaped the DNA of all Porsche models. Including, of course, the 911 Cabriolet and Targa models.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(11, 'Honda Civic Type R', 'Reimagined and reinvented, the Honda Civic is set to reignite the thrill of driving again with the responsive 1.6L i-VTEC engine and Hondas latest 1.5L VTEC TURBO engine. The thrill continues in the surrounds of a quietly sophisticated and spacious cabin. Redefine your limits of thrill with the Honda Civic.', );
INSERT INTO `product_data` (`product_id`, `product_name`, `product_description`, `product_image`) VALUES
(12, 'Hyundai Avante', 'Sensuous sportiness refers to Hyundai Motor\'s next-generation design direction. It illustrates the design taste that have built over the years by developing vehicles that are futuristic and sporty. Based on the principle of blending the intrinsic and intuitive beauty of automobiles with our very specific taste in terms of styling, proportion, architecture and technology, it totally reflects our philosophy of design.', );

